def solve(s):
    res = ''
    reverse = False
    for c in s:
        if c.isalpha():
            if c.isupper():
                res += c.lower()
            else:
                res += c.upper()
        else:
            res += c
        reverse = not reverse
    if not any(c.isalpha() for c in s):
        return ''.join(reversed(res))
    return res[::-1]

